import styled from 'styled-components'


const MainWrapper = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  /* align-items: center; */
  padding: 16px 0px;
  height: 100vh;
  width: 100%;
  background-color : ${properties.bgGray};
`
