  justify-content: center;
  background-color : ${properties.bgGray};
`
const SubColLogo = styled.div`
  width: 63px;
  height: 64px;
  background-color : ${properties.bgGray};
  background-image: url(${props => props.favicon});
  background-size: cover;
`
const SubCol2 = styled.div`
  width: 300px;
  height: 50%;
  display: flex;
  flex-direction: column;
  margin: 24px ;
  padding: 0px 24px;
  padding-bottom: 24px;
  border: 1px solid rgba(0, 40, 100, 0.12);
  background-color : ${properties.white}; 
  @media (max-width: 500px) {
  width: 70%;
  margin: 12px ;
  padding: 0px 12px;
  padding-bottom: 12px;
} 
`
const Col1 = styled.div`
  padding: 24px 0px;
} 
`
const Col2 = styled.div`
  padding-bottom: 10px;
} 
`
let Input = styled.input`
border: 1px solid rgba(0, 40, 100, 0.12);
height: 38px;
width: 96%;
border-radius: 5px;
color: ${properties.littleLightGrey};
font-size: ${fSize.sMedium};
padding: 0px 0px 0px 10px;
`
const Col3 = styled.div`
height: 38px;
padding-bottom: 24px;
`
let Input2 = styled.input`
border: 1px solid rgba(0, 40, 100, 0.12);
height: 38px;
width: 96%;
border-radius: 5px;
color: ${properties.littleLightGrey};
font-size: ${fSize.sMedium};
padding: 0px 0px 0px 10px;
`
const Col4 = styled.div`
height: 38px;

`
const Col5 = styled.div`
float: right;
