  render() {
    return (<div>


      <MainWrapper >
        <SubWrapper1 >
          <SubCol1>
            <SubColLogo favicon={favicon} />
          </SubCol1>
          <SubCol2>
            <form height={"100%"}>
              <Col1>
                <TextBox
                  color={properties.littleLightGrey}
                  fontSize={fSize.slarge}>
                  Login to your account
              </TextBox>
              </Col1>
              <Col2>
                <TextBox
                  ffamily={"semiBold"}
                  color={properties.littleLightGrey}
                  fontSize={fSize.mSmall}>
                  Email address
              </TextBox>
              </Col2>
              <Col3>
                <Input placeholder="Enter Email" />
              </Col3>
              <Col2>
                <TextBox
                  ffamily={"semiBold"}
                  color={properties.littleLightGrey}
                  fontSize={fSize.mSmall}>
                  Password
              </TextBox>
              </Col2>
              <Col4>
                <Input2 placeholder="Password" type="password" />
              </Col4>
              {/* <p>Enter your age:</p>
              <input
                type='text'
                name='age'
                // onChange={this.myChangeHandler}
              />
              {this.state.errormessage} */}
              <Col5>
                <TextBox

                  ffamily={"regular"}
                  color={properties.otherBlue}
                  fontSize={fSize.lSmall}>
                  I forgot password
              </TextBox>
              </Col5>
              <Col6>
                <input type="checkbox" ></input>
                <TextBox
                  ffamily={"semiBold"}
                  color={properties.littleLightGrey}
                  fontSize={fSize.mSmall}>
                  Remember me
              </TextBox>

              </Col6>
            </form>

            {/* 

            <Col6>
              <TextBox
                ffamily={"semiBold"}
                color={properties.littleLightGrey}
                fontSize={fSize.mSmall}>
                Login to your account
              </TextBox>
            </Col6>
            <Col7>
              <TextBox
                ffamily={"semiBold"}
                color={properties.littleLightGrey}
                fontSize={fSize.mSmall}>
                I forgot password
              </TextBox>
            </Col7>
            <Col8>
              <TextBox
                ffamily={"semiBold"}
                color={properties.littleLightGrey}
                fontSize={fSize.mSmall}>
                Login to your account
              </TextBox>
            </Col8> */}
          </SubCol2>
        </SubWrapper1>
      </MainWrapper>


    </div >
    )
  }
}

export default LogIn
